// Sets o.R.Region to nil.
// Removes o from all passed in related items' relationships struct (Optional).
func (o *Address) RemoveRegion(exec boil.Executor, related *Region) error {
	var err error

	o.RegionID.Valid = false
	if err = o.Update(exec, "region_id"); err != nil {
		o.RegionID.Valid = true
		return errors.Wrap(err, "failed to update local table")
	}

	o.R.Region = nil
	if related == nil || related.R == nil {
		return nil
	}

	for i, ri := range related.R.Addresses {
		if o.RegionID.Int != ri.RegionID.Int {
			continue
		}

		ln := len(related.R.Addresses)
		if ln > 1 && i < ln-1 {
			related.R.Addresses[i] = related.R.Addresses[ln-1]
		}
		related.R.Addresses = related.R.Addresses[:ln-1]
		break
	}
	return nil
}

